      | 366504 -> { ItemTypeData.id= 366504; name= "State Wiyrkomi Swarm Launcher"; published= false; description= "A mid-range anti-material weapon, the shoulder-mounted rocket launcher provides infantry squads with the means to effectively engage armored vehicles and installation gun emplacements. With pre-launch lock-on capabilities and intelligent swarm missiles, it is a man-portable system able to deliver devastating payloads against material targets.   Key to its success is the swarm missile technology. Fired in salvos, each warhead is fitted with an onboard guidance controller, which introduces random deviations and unpredictable patterns into the swarm's flight path, allowing some, if not all, missiles in the salvo to defeat basic countermeasure systems."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366698 -> { ItemTypeData.id= 366698; name= "Commando C-I"; published= false; description= "The Commando dropsuit is a variable combat unit capable of reacting to battlefield threats as they emerge. Built using a repurposed heavy frame, the suit is designed for maximum offensive flexibility. The streamlined frame does away with extraneous armor layers, using the augmented power of the exoskeleton to instead shoulder the weight and bulk of two light-class weapons.    Utilizing technologies sourced from across the State, the Commando’s subframe is hardwired with custom-built damage modifiers that enhance the output of all light-class railgun weaponry synched with the suit’s core operating system. This is achieved, in part, by managing the weapon’s charge efficiency in order to ensure maximum impact of every discharge.    The Commando is the ultimate suppression fighter. What the suit sacrifices in tactical versatility, it more than makes up for with flexible weapon loadouts that can counter any of the myriad threats an ever-evolving battlefield may present."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
