      | 55716 -> { ItemTypeData.id= 55716; name= "Hel Freedom's Revolution SKIN"; published= true; description= "For the Minmatar people the Great Rebellion was the founding revolutionary event that set them on the path to freedom in their Tribal Republic. The Freedom's Revolution nanocoating celebrates that struggle for freedom, the lives lost and the great gains made by the Minmatar.    While Liberation Day is a grand celebration of the day freedom was achieved for billions of Minmatar, it is also a day of remembrance of those Matari who still languish as slaves in the Amarr Empire, Khanid Kingdom, and the lawless reaches of New Eden."; marketGroupId= Some(1977); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
