      | 56201 -> { ItemTypeData.id= 56201; name= "Astrahus Upwell Quantum Core"; published= true; description= "This Upwell Quantum Core is capable of supporting fully-functional and efficient operations of an Astrahus-class structure, given that the structure is also fuelled and fully-powered.    Many of the functions of Upwell structures depend on stable, high-bandwidth FTL communications that enable many vital systems to query navigation infrastructure, remote market databases, ship registries and a host of other datasets in a timely fashion. The heart of any major structure's communications technology is the Quantum Core. This facility is essentially a large array of fluid routers coupled with an integrated restricted AI that acts as the orchestrator of all FTL communications traffic flowing through it.    Quantum Cores not only contain some of the most advanced RAIs permitted under the Yulai Convention but also necessarily contain relatively large quantities of quantum-entangled 4-Helium distributed through the many fluid routers in the core array. These characteristics make Quantum Cores some of the most valuable pieces of technology in New Eden, and their vital role in Upwell structure operations means they are housed in the most central and heavily-protected location on any given structure."; marketGroupId= Some(2749); groupId= 4086; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 4000.000000; packagedVolume= 500.000000; portionSize= 1; radius= 1.000000; volume= 500.000000 } |> Some
